import React from 'react';
import { Link } from "react-router-dom";


function Search() {

  return (
    <div>
        <section className="card ">
            <div className="card-body" >
                <Link className="btn searchbtn btn-secondary active"  role="button" aria-pressed="true" to="SearchFoodPage">
                    Search by Food
                </Link>
                <Link className="btn searchbtn btn-secondary active"  role="button" aria-pressed="true" to="SearchMealPage">
                    Search by Meal Type
                </Link>
                <Link className="btn searchbtn btn-secondary active"  role="button" aria-pressed="true" to="SearchGroupPage">
                    Search by Food Group
                </Link>
            </div>
        </section>
    </div>
  );
}

export default Search;
